import React from 'react';

const MoviesLists = ({movies}) => {
    return ( 
        <table className='table'>
            <thead>
                <tr>
                    <th>ID</th>
                    <th>Title</th>
                    <th>Date</th>
                    <th>Type</th>
                </tr>
            </thead>
            <tbody>
                {movies.map(movie => (
                <tr key={movie.id}>
                    <th>{movie.id}</th>
                    <th>{movie.title}</th>
                    <th>{movie.date}</th>
                    <th>{movie.type}</th>
                </tr>
                ))}
            </tbody>
        </table>
     );
}
 
export default MoviesLists;
